import React from 'react';
import './CSS/result.css'
import sha256 from 'js-sha256'

class Result extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: props.data,
        };
        this.handleData = this.handleData.bind(this);
    }

    componentWillReceiveProps(props) {
        this.setState({ data: props.data });
    }

    handleData(name) {
        console.log(this.state.data);
        if (!(name in this.state.data)) return;
        let res = [];
        let data = this.state.data[name];
        for (let i in data) res.push(
            <div className='resultItems'
                id={sha256(i)}>
                {i}:{data[i]}
            </div>);
        return res;
    }

    render() {
        let a = { ...this.state.data.basic };
        return (<div className='result'>
            <div className='title'>结果</div>
            <div className='resultBasic'>

            </div>
            <div className='resultTable'>
                <div className='resultTitle'>学术能力</div>
                {this.handleData('Academic')}
                <div className='resultTitle'>社交能力</div>
                {this.handleData('Social')}
                <div className='resultTitle'>普通能力</div>
                {this.handleData('Normal')}
            </div>
            <div className='backgroundStory'>
                {a.background}
            </div>
        </div>);
    }
}

export default Result;
